%[text] Oriented bounding box
% Assuming 'ptCloud' is a pointCloud object
% 'model' will contain the parameters of the fitted cuboid
[model, inlierIndices, outlierIndices] = pcfitcuboid(ptCloud);

% 'model.Parameters' returns the bounding box in the format [x, y, z, length, width, height, roll, pitch, yaw]
bbox_oriented = model.Parameters;

% To visualize the result:
figure
pcshow(ptCloud)
hold on
plot(model) % Overlays the fitted cuboid on the point cloud
hold off
