%[text] # Local Functions
%[text] ## Create Volume 
function Vol = createShape
% Sphere
center1 = -20;
center2 = -center1;
dist = sqrt(3*(2*center1)^2);
radius = dist/2 * 1.4;
lims = [floor(center1-1.2*radius) ceil(center2+1.2*radius)];
[x,y,z] = meshgrid(lims(1):lims(2));
volBol = sqrt((x-center1).^2 + (y-center1).^2 + ...
    (z-center1).^2) <= radius;
volBol = uint8(volBol);
volBol(volBol>0) = 64; % set sphere voxels to 64

% Diamond
[fvOct.vertices, fvOct.faces] = createOctahedron; % diamond shape
fvOct.vertices = fvOct.vertices * 100;
fvOct.vertices(:,1) = fvOct.vertices(:,1) + 10;
fvOct.vertices(:,2) = fvOct.vertices(:,2) + 10;
fvOct.vertices(:,3) = fvOct.vertices(:,3) + 10;
volOct = polygon2voxel(fvOct,size(volBol),'auto'); % create volume containing diamond
volOct = imfill(volOct, 'holes');
volOct = uint8(volOct);
volOct(volOct>0) = 128; % set diamond voxels to 128

% Box
[fvBox.vertices, fvBox.faces] = createCube;
fvBox.vertices = fvBox.vertices * 100;
fvBox.vertices(:,1) = fvBox.vertices(:,1) + 10; % x position
fvBox.vertices(:,2) = fvBox.vertices(:,2) + 10;
fvBox.vertices(:,3) = fvBox.vertices(:,3) + 10;
fvBox.faces = boundary(fvBox.vertices);
volBox = polygon2voxel(fvBox,size(volBol),'none'); % create volume containing cube same size as sphere
volBox = imfill(volBox,'holes');
volBox = uint8(volBox);
volBox(volBox>0) = 192; % set box voxels to 192

% Cylinder
[fvCyl.vertices, fvCyl.faces] = cylinderMesh([30 30 5 30 30 95 20], 'closed');% [X1 Y1 Z1 X2 Y2 Z2 R]
% fvCyl.vertices = mmRotateSurfaceVertices(fvCyl.vertices,'x',90);
volCyl = polygon2voxel(fvCyl,size(volBol),'auto'); % create volume containing cylinder, same size as sphere
volCyl = imfill(volCyl,'holes');
volCyl = uint8(volCyl);
volCyl(volCyl>0) = 250; % set cylinder voxels to 250

% Merged volume
Vol = [volOct volBox; volBol volCyl]; % merged volume
end

